import axios from "axios";

export const getTodos = (id) =>
  axios.get("https://jsonplaceholder.typicode.com/todos");

export const insertTodos = (todo) =>
  axios.post("https://jsonplaceholder.typicode.com/todos", todo);

export const updateTodos = (todo) =>
  axios.put("https://jsonplaceholder.typicode.com/todos/2", todo);

export const deleteTodos = (id) =>
  axios.delete("https://jsonplaceholder.typicode.com/todos/4");
